import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap-icons/font/bootstrap-icons.css";

const Header = () => {
    return (
        <nav className="navbar navbar-expand-lg bg-light">
          <div className="container">
            {/* Logo */}
            <a className="navbar-brand" href="#">
              <img src="/public/logo/Logo.svg" alt="Logo" style={{ height: "50px", width: "auto" }} />
            </a>

            {/* Bouton Menu Mobile */}
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
            >
              <span className="navbar-toggler-icon"></span>
            </button>

            {/* Liens de Navigation */}
            <div className="collapse navbar-collapse justify-content-center" id="navbarNav">
              <ul className="navbar-nav">
                <li className="nav-item"><a className="nav-link" href="#">Accueil</a></li>
                <li className="nav-item"><a className="nav-link" href="#">À Propos</a></li>
                <li className="nav-item"><a className="nav-link" href="#">Mes Services</a></li>
                <li className="nav-item"><a className="nav-link" href="#">Projets</a></li>
                <li className="nav-item"><a className="nav-link" href="#">Contact</a></li>
              </ul>
            </div>

            {/* Icônes Sociales */}
            <div className="d-flex align-items-center">
              <a href="#" className="text-dark mx-2"><i className="bi bi-linkedin"></i></a>
              <a href="#" className="text-dark mx-2"><i className="bi bi-github"></i></a>
            </div>
          </div>
        </nav>
      );

}

export default Header;
